import React, {useState, useEffect} from 'react';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import { Rate } from 'antd';
import {ReviewButton, PostHeader} from './ShowPost';
import { ArrowLeftOutlined } from '@ant-design/icons';
const ReviewWrite=()=> {
  
    const [currentValue, setCurrentValue] = useState(0)
    
    return (
    <>
      <PostHeader style={{border:'none', padding:'12px'}}>
        <ArrowLeftOutlined style={{fontSize:'20px', marginTop:'3px'}}/>
        <h1 style={{fontWeight:'bold', fontSize:'18px', position:'absolute',left:'80px', top:'12px'}}>대여후기 작성</h1>
        <ReviewButton style={{display:'inline-block', fontSize:'12px',height:'25px', textAlign:'center'}}type="primary">완료</ReviewButton>    
      </PostHeader>
      <PostHeader style={{flexDirection:'column', alignItems:'center'}}>
      <Rate allowHalf onChange={(value) => {
        setCurrentValue(value)
      }} value={currentValue} style={{color:'#EBCAFD'}}/> <br />
      {/* Current Rating: {currentValue} */}
      <p style={{color:'#7D7D7D', fontSize:'13px', fontWei}}>별을 탭하여 평가해주세요</p>
      </PostHeader>
      </>
    );
  }

export default ReviewWrite;
